async def get_car(car_id: int, car_hue: int = 0, size: str = 'large'):
    host = 'https://www.nitrotype.com/cars'

    if car_hue != 0:
        host += '/painted/%s_%s_1_%s.png' % (car_id, size, car_hue)
    else:
        host += '/%s_%s_1.png' % (car_id, size)

    async with aiohttp.get(host) as r:

        # Checking if response ok
        if r.status != 200:
            return None

        b = BytesIO()
        b.write(await r.read())
        b.seek(0)
        return b


